<template>
  <view
    bubble="true"
    :class="[
      'n-position-relative',
      'n-flex-column',
      'n-align-center',
      'n-justify-center',
      'n-hover-' + hover + '-n',
    ]"
    :style="boxStyle"
    :hover-class="'n-hover-' + hover"
    @click.stop="clicked"
  >
    <image v-if="isImgSrc" class="n-image" :src="name" mode="aspectFill" :style="iconStyle"></image>
    <text v-else :class="['n-iconfont', 'n-color-' + type, 'n-size-' + size]" :style="iconStyle">{{
      icons[name]
    }}</text>
    <slot></slot>
  </view>
</template>

<script>
/**
 * n-icon
 * @description 图标
 * @property {Boolean} stop = [true|false] 是否允许穿透，默认true:不允许
 * @property {String} name 字体图标的名字，允许是图片路径
 * @property {String} type = [nav-title|nav-icon|nav-item|primary|success|warning|error|inverse|custom|link|text|second|third|forth|place|disabled] 图标的颜色主题
 * @property {String} size = [ss|s|base|l|ll] 图标的尺寸主题
 * @property {String} hover = [opacity|bg|bg-dark|bg-opacity|none] hover主题
 * @property {String} iconStyle 图标或者图片样式
 * @property {String} boxStyle 外层样式
 * @event {Function} iconClicked 点击事件
 */
// #ifdef APP-NVUE
const dom = uni.requireNativePlugin('dom')
dom.addRule('fontFace', {
  fontFamily: 'npro',
  src: "url('data:font/ttf;charset=utf-8;base64,')",
})
// #endif
</script>

<script setup>
import { computed } from 'vue'
import { makeProps } from '../utils/props.js'

import icons from './icons.js'
import { isSrc } from '../utils/utils.js'

const emit = defineEmits(['iconClicked'])
const props = defineProps(
  makeProps([
    ['stop', true],
    'name',
    ['type', 'text'],
    ['size', 'base'],
    'hover',
    'iconStyle',
    'boxStyle',
  ])
)

const isImgSrc = computed(() => {
  if (isSrc(props.name)) {
    return true
  }
  const last_len = props.name.lastIndexOf('.')
  if (last_len > 0) {
    const len = props.name.length
    const ext = props.name.substring(last_len, len)
    return ['.png', '.jpg', '.jpeg', '.webp', '.gif', '.bmp', '.svg'].includes(ext.toLowerCase())
  }
  return false
})

function clicked(e) {
  emit('iconClicked', e)
  props.stop && e && e.stopPropagation && e.stopPropagation()
}
</script>

<style lang="scss" scoped>
/* #ifndef APP-NVUE */
@font-face {
  font-family: 'npro';
  src: url('https://at.alicdn.com/t/font_2525902_09a359y0nn9u.woff2?t=1634117219037')
      format('woff2'),
    url('https://at.alicdn.com/t/font_2525902_09a359y0nn9u.woff?t=1634117219037') format('woff'),
    url('https://at.alicdn.com/t/font_2525902_09a359y0nn9u.ttf?t=1634117219037') format('truetype'),
    url('https://at.alicdn.com/t/font_2525902_09a359y0nn9u.svg?t=1634117219037#npro') format('svg');
}
/* #endif */

.n-iconfont {
  font-family: npro;
  text-decoration: none;
  text-align: center;
}
.n-image {
  width: 32rpx;
  height: 32rpx;
}
</style>
